// import logo from './logo.svg';
import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import {
  Navbar,

  Button,

  Form,
  FormControl,
  Container,
  Row,
  Col,
  Tab, Image


} from "react-bootstrap";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";


export default class App extends Component {
  render() {
    return (
      <Container fluid position="center">
        <Row className="border">
          <Navbar bg="light" expand="lg" className="ta-1">
            <Navbar.Brand>
              <img
                alt="Instagram"
                class="s4Iyt"
                src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
                srcset="/static/images/web/mobile_nav_type_logo-2x.png/1b47f9d0e595.png 2x"
                cursor="pointer"
              ></img>
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Form inline>
                <FormControl
                  type="text"
                  placeholder="Search"
                  className="mr-sm-2"
                />
                <Button variant="outline-success">Search</Button>
              </Form>
            </Navbar.Collapse>
          </Navbar>
        </Row>

        <Router>
          <Tab.Container id="left-tabs-example" defaultActiveKey="first">
            <Row>
              <Col md={2}>
                <p>
                  <Link to="/accounts/edit">Edit Profile</Link>
                </p>
                <p>
                  <Link to="/accounts/password/change">Change Password</Link>
                </p>
                <p>
                  <Link to="/accounts/manage_access">Apss and Websites</Link>
                </p>
                <p>
                  <Link to="/emails/settings">Email and SMS</Link>
                </p>
                <p>
                  <Link to="/push/web/settings">Push Notifications</Link>
                </p>
                <p>
                  <Link to="/accounts/contact_history">Manage Contacts</Link>
                </p>
                <p>
                  <Link to="/accounts/privacy_and_security">
                    Privacy and Scurity
                  </Link>
                </p>
                <p>
                  <Link to="/session/login_activity">Login Activity</Link>
                </p>
                <p>
                  <Link to="/emails/emails_sent">Emails from Instagram</Link>
                </p>
              </Col>
              <Col md={10}>
                <Switch>
                <Route path="/accounts/edit" component={Edit} />
                <Route path="/accounts/password/change" component={Change} />
                <Route path="/accounts/manage_access" component={Apss} />
                <Route path="/emails/settings" component={Email} />
                <Route path="/push/web/settings" component={Push} />
                <Route path="/accounts/contact_history" component={Manage} />
                <Route path="/accounts/privacy_and_security" component={Privacy} />
                <Route path="/session/login_activity" component={Login} />
                <Route path="/emails/emails_sent" component={Emails} />              

                </Switch>
              </Col>
            </Row>
          </Tab.Container>
        </Router>
      </Container>
    );
  }
}



class Edit extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col md={2} className="float-right">
            <img className="float-right" src="https://instagram.fada2-1.fna.fbcdn.net/v/t51.2885-19/44884218_345707102882519_2446069589734326272_n.jpg?_nc_ht=instagram.fada2-1.fna.fbcdn.net&_nc_ohc=SkQvnEdYBN8AX-tYmCd&oh=c42861bdaa4bb6a18094f8bf99bb7f78&oe=6057FD8F&ig_cache_key=YW5vbnltb3VzX3Byb2ZpbGVfcGlj.2" alt="Girl in a jacket" width="100%" height="100%"/>
          </Col>
          <Col md={10} >
            <p >satu</p>
          </Col>
        </Row>
        <Row>
          <Col md={5}> <p>satu</p>
          </Col>
          <Col md={7}> <p>satu</p>
          </Col>
        </Row>
        <Row>
          <Col md={5}>
          </Col>
          <Col md={7}>
          </Col>
        </Row>
        <Row>
          <Col md={5}>
          </Col>
          <Col md={7}>
          </Col>
        </Row>
        <Row>
          <Col md={5}>
          </Col>
          <Col md={7}>
          </Col>
        </Row>
        <Row>
          <Col md={5}>
          </Col>
          <Col md={7}>
          </Col>
        </Row>

      </Container>
    )

  }
}

class Change extends Component {
  render() {
    return <h2>Change</h2>;
  }
}

class Apss extends Component {
  render() {
    return <h2>Apss</h2>;
  }
}

class Email extends Component {
  render() {
    return <h2>Email</h2>;
  }
}

class Push extends Component {
  render() {
    return <h2>Push</h2>;
  }
}
class Manage extends Component {
  render() {
    return <h2>Manage</h2>;
  }
}
class Privacy extends Component {
  render() {
    return <h2>Privacy</h2>;
  }
}
class Login extends Component {
  render() {
    return <h2>Login</h2>;
  }
}
class Emails extends Component {
  render() {
    return <h2>Emails</h2>;
  }
}
